Continue anyways?

translation:
Următoarele patch-uri au fost eliminate de la ultima dată când le-ați folosit.

${patches}

Continuați oricum?

source_string:
The version of the app you have selected does not match the suggested version which can lead to unexpected issues. Please use the suggested version.

Selected version: ${selected}
Suggested version: ${suggested}

To continue anyway, disable "Require suggested app version" in the settings.

translation:
Versiunea aplicației pe care ați selectat-o nu se potrivește cu versiunea sugerată. Vă rugăm să selectați aplicația care se potrivește cu versiunea sugerată.

Versiune selectată: v${selected}
Sugestie versiune: v${suggested}

Pentru a continua oricum, dezactivați "Necesită versiunea sugerată a aplicației" în setări.

source_string:
